import React, { useState } from "react";
import "../index.css";

import Contact from "./contact";
import About from "./about";

export default function Header() {
  const [about, showAbout] = useState(false);
  const [portfolio, showPortfolio] = useState(false);
  const [contact, showContact] = useState(false);

  const toggleAbout = () => showAbout(!about);
  const togglePortfolio = () => showPortfolio(!portfolio);
  const toggleContact = () => showContact(!contact);

  return (
    <>
      <div className="header">
        <h1>Robert Girardin | Front End Developer |</h1>
        <h1 onClick={toggleAbout}>About</h1> <h1>|</h1>
        <h1 onClick={() => showPortfolio(true)}>Portfolio</h1>
        <h1>|</h1>
        <h1>
          <a
            target="_blank"
            rel="noopener noreferrer"
            href="https://drive.google.com/uc?export=download&id=1MuTUti9eAbvmtat6PlxtwZOqqqaFJCxw"
          >
            Resume
          </a>
          <h1>|</h1>
          <h1 onClick={toggleContact}>Contact</h1>
        </h1>
      </div>
      <div className="spacer" />
      {contact && <Contact />}
      {about && <About />}
    </>
  );
}
